INSERT INTO `article` VALUES ('4', '安全保障', '11', null, '<p style=\"white-space: normal; text-align: center;\"><strong><span style=\"font-size: 24px; font-family: 宋体;\">风控体系</span></strong></p><p style=\"white-space: normal; text-align: center;\"><strong>&nbsp;</strong></p><p style=\"white-space: normal;\"><span style=\"font-family: 宋体;\">（</span>1<span style=\"font-family: 宋体;\">）互联网、计算机等线上技术保障用户账户安全、信息安全。包括：沃通</span>OV<span style=\"font-family: 宋体;\">国际认证</span>SSL<span style=\"font-family: 宋体;\">数据加密、</span>360<span style=\"font-family: 宋体;\">网站安全检测、中国电子商务协会可信网站信用评级、品牌宝安全联盟行业认证。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 宋体;\">（</span>2<span style=\"font-family: 宋体;\">）健全的风控体系，严格的保密制度，谨慎的风控流程（线上审核</span>+<span style=\"font-family: 宋体;\">线下实地考察）。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 宋体;\">（</span>3<span style=\"font-family: 宋体;\">）所有项目均由独立第三方融资性担保公司进行担保，最大程度保障投融资双方的利益。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 宋体;\">（</span>4<span style=\"font-family: 宋体;\">）担保公司保障金制度先行赔付保障投资者的利益。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 宋体;\">（</span>5<span style=\"font-family: 宋体;\">）债权转让制度，方便投资者投资，同时方便需要资金周转和提前收回资金的投资者。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 宋体;\">（</span>6<span style=\"font-family: 宋体;\">）拒绝资金池，避免投资者资金进入公司账户，杜绝</span>P2P<span style=\"font-family: 宋体;\">公司卷款跑路的情况。</span></p><p style=\"white-space: normal;\">&nbsp;</p><p style=\"white-space: normal;\"><strong><span style=\"font-family: 宋体;\">实地考察：</span></strong><span style=\"font-family: 宋体;\">汇泰在线所有的标的均由实地调查及征信等（如鹏元征信等）数据组成。调查结果均达到了能被任意金融机构直接用于风险定级的程度，层层审核从源头保障投资者利益。</span></p><p style=\"white-space: normal;\"><strong><span style=\"font-family: 宋体;\">风控备用金：</span></strong><span style=\"font-family: 宋体;\">汇泰在线采取了风险备用金来保障出借人的利益，如若出现逾期，马上启动风险备用金来保证出借人的本金和利息目前借款逾期率较低，通过积累，风险备用金能够覆盖逾期借款，出借人资金相对较为安全。</span></p><p style=\"white-space: normal;\"><strong><span style=\"font-family: 宋体;\">资金第三方托管：</span></strong><span style=\"font-family: 宋体;\">汇泰在线委托第三方机构对用户资金进行管理，不与公司运营资金混用；用户可随时查询账户详情，平台内部制定了严格的资金管理流程和完善的系统，进行监督监控，降低操作风险。</span></p><p style=\"white-space: normal;\"><strong><span style=\"font-family: 宋体;\">充分的担保：</span></strong><span style=\"font-family: 宋体;\">汇泰在线委托有实力的担保公司对债权进行担保，如若出现不良债权时，担保公司将启动担保资金对出借人进行担保代偿，确保出借人的资金风险。</span>&nbsp;</p><p style=\"white-space: normal;\"><strong><span style=\"font-family: 宋体;\">透明的资金流向</span></strong></p><p style=\"white-space: normal;\"><span style=\"font-family: 宋体;\">汇泰在线平台坚持阳光化运营，资金的流转使用信息都可查询，信息交流真实、透明，投资人拥有最大限度的完整的知情权。</span></p><p style=\"white-space: normal;\">&nbsp;</p><p style=\"white-space: normal;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img src=\"http://www.huitai188.com/attachment/upload/image/2016/04/26/03/20/52/1461612052279507.jpg\" title=\"1461612052279507.jpg\" alt=\"ssss.jpg\"/></p><p style=\"white-space: normal;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <img src=\"http://www.huitai188.com/attachment/upload/image/2016/04/26/03/21/11/1461612071430847.jpg\" title=\"1461612071430847.jpg\" alt=\"p2p.jpg\"/>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img src=\"http://www.huitai188.com/attachment/upload/image/2016/04/26/03/21/23/1461612083875056.jpg\" title=\"1461612083875056.jpg\" alt=\"流程图-.jpg\"/></p><p style=\"white-space: normal;\">&nbsp;</p><p><br/></p>', '5', null, null, null, 'guest', '1', 'regular', '1461723184');
