INSERT INTO `front_nav` VALUES ('2', '平台介绍', '1', '1', '19', 'id=2', 'about', '平台介绍', '平台介绍', '平台介绍', 'none', '/about/intro/', 'show.html', '<p><span style=\"font-size: 20px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img src=\"http://www.huitai188.com/attachment/upload/image/2016/04/27/16/06/31/1461744391517767.jpg\" title=\"1461744391517767.jpg\" alt=\"1461744391517767.jpg\" width=\"919\" height=\"267\" border=\"0\" vspace=\"0\" style=\"width: 919px; height: 267px;\"/></span></p><p><span style=\"font-size: 18px;\">汇泰在线（www.huitai188.com）是通过移动互联网和大数据技术，凭借</span><span style=\"font-size: 18px;\">多年金融IT建设经验，以及对互联网的深刻洞察和理解，创造专业、成熟、严谨的风控系统，秉承安全、便捷、诚信、透明的服务理念，建立创新、简单、规范、高效的咨询服务平台，在互联网金融浪潮中，以服务三农、中小微企业及大众用户为宗旨，精准聚焦财富资产管理，打造互联网金融生态圈为目标，以强烈的社会责任与使命感，为广大客户提供全方位、个性化的普惠金融与财富管理的综合性服务平台，以雄厚的业界资源和社会影响力为金融机构创新发展增添动力，制定及引领行业新标准、新风尚，实现企业与客户价值共同成长，倾力铸就口碑与效益双赢的金融民心品牌。</span></p>', 'no', '0', 'off', 'off', 'regular');
INSERT INTO `front_nav` VALUES ('3', '法律法规', '1', '1', '19', 'id=3', null, '法律法规', '法律法规', '法律法规', 'none', '/about/policy/', 'show.html', '<h3 style=\"margin-top:20px;margin-right:0;margin-bottom:10px;margin-left: 0;line-height:32px;background:white\"><a name=\"_GoBack\"><span style=\"font-size: 16px;font-family: 微软雅黑, sans-serif;color: rgb(34, 78, 115)\"><img src=\"http://www.huitai188.com/attachment/upload/image/2016/04/27/17/11/10/1461748270230953.jpg\" title=\"1461748270230953.jpg\" alt=\"法律法规.jpg\"/></span></a></h3><h3 style=\"margin-top:20px;margin-right:0;margin-bottom:10px;margin-left: 0;line-height:32px;background:white\"><a name=\"_GoBack\"><span style=\"font-size: 16px;font-family: 微软雅黑, sans-serif;color: rgb(34, 78, 115)\">关于投资人及借款人双方民间借贷的合法性：明确合法</span></a></h3><p style=\"margin-bottom:10px;text-indent:28px;line-height:26px;background:white\"><span style=\"font-size: 14px;font-family: 微软雅黑, sans-serif;color: rgb(51, 51, 51)\">根据《合同法》第196条规定&quot;借款合同是借款人向贷款人借款，到期返还借款并支付利息的合同&quot;，《合同法》允许普通民事主体之间发生借贷关系，并允许出借方到期可以收回本金和符合法律规定的利息。</span></p><h3 style=\"margin-top:20px;margin-right:0;margin-bottom:10px;margin-left: 0;line-height:32px;background:white\"><span style=\"font-size: 16px;font-family: 微软雅黑, sans-serif;color: rgb(34, 78, 115)\">关于汇泰提供居间撮合服务的合法性：明确合法</span></h3><p style=\"margin-bottom:10px;text-indent:28px;line-height:26px;background:white\"><span style=\"font-size: 14px;font-family: 微软雅黑, sans-serif;color: rgb(51, 51, 51)\">根据《合同法》第23章关于&quot;居间合同&quot;的规定，特别是第424条规定的&quot;居间合同是居间人向委托人报告订立合同的机会或者提供订立合同的媒介服务，委托人支付报酬的合同&quot;，汇泰为民间借贷提供撮合借贷双方形成借贷关系的居间服务有着明确的法律基础。</span></p><h3 style=\"margin-top:20px;margin-right:0;margin-bottom:10px;margin-left: 0;line-height:32px;background:white\"><span style=\"font-size: 16px;font-family: 微软雅黑, sans-serif;color: rgb(34, 78, 115)\">关于电子合同的合法性及可执行性：现行法律明确确定了合同效力</span></h3><p style=\"margin-bottom:10px;text-indent:28px;line-height:26px;background:white\"><span style=\"font-size: 14px;font-family: 微软雅黑, sans-serif;color: rgb(51, 51, 51)\">根据《电子签名法》的规定，民事活动中的合同或者其他文件、单证等文书，当事人可以约定使用电子签名、数据电文，不能因为合同采用电子签名、数据电文就否定其法律效力。同时，《电子签名法》中还规定，可靠的电子签名与手</span><span style=\"font-size: 14px;font-family: 微软雅黑, sans-serif;color: rgb(51, 51, 51)\">写签名或者盖章具有同等的法律效力。明确肯定了符合条件的电子签名与手写签名或盖章具有同等的效力。</span></p><h3 style=\"margin-top:20px;margin-right:0;margin-bottom:10px;margin-left: 0;line-height:32px;background:white\"><span style=\"font-size: 16px;font-family: 微软雅黑, sans-serif;color: rgb(34, 78, 115)\">关于投资人在汇泰所获得的出借理财收益的合法性:为合法收益,受到法律保护</span></h3><p style=\"margin-bottom:10px;text-indent:28px;line-height:26px;background:white\"><span style=\"font-size: 14px;font-family: 微软雅黑, sans-serif;color: rgb(51, 51, 51)\">根据最高人民法院《关于人民法院审理借贷案件的若干意见》第6条：&quot;民间借贷的利率可以适当高于银行的利率，各地人民法院可以根据本地区的实际情况具体掌握，但最高不得超过银行同类贷款利率的四倍，（包含利率本款）。超出此限度的，超出部分的利息不予保护。&quot;汇泰的出借理财收益低银行同类贷款利率的四倍，为合法利息收益，受到法律保护。</span></p><p><br/></p>', 'no', '0', 'off', 'off', 'regular');
