INSERT INTO `front_nav` VALUES ('7', '管理团队', '1', '1', '19', 'id=7', 'about', '  ', '  ', '  ', 'none', '/about/responsibility/', 'show.html', '<p><img src=\"http://www.huitai188.com/attachment/upload/image/2016/04/27/17/42/04/1461750124745762.png\" title=\"1461750124745762.png\" alt=\"1461750124745762.png\" width=\"115\" height=\"150\" border=\"0\" vspace=\"0\" style=\"width: 115px; height: 150px; float: left;\"/><strong><span style=\"font-size: 19px; font-family: 微软雅黑, sans-serif; color: rgb(12, 12, 12);\">&nbsp; &nbsp; &nbsp; &nbsp;周天 首席执行官</span></strong><span style=\"font-size: 19px; font-family: 微软雅黑, sans-serif; color: rgb(12, 12, 12);\">&nbsp;</span></p><p><span style=\"color: rgb(12, 12, 12); font-family: 微软雅黑, sans-serif; font-size: 19px; text-indent: 37px;\">&nbsp; &nbsp; &nbsp; &nbsp;周天，早年从商，多年的金融管理经验，熟练掌握车贷、房贷、担保业务的运作及风险控</span></p><p><span style=\"color: rgb(12, 12, 12); font-family: 微软雅黑, sans-serif; font-size: 19px; text-indent: 37px;\">&nbsp; &nbsp; &nbsp; &nbsp;制，对互联网金融领域有深入的研究，创造独特的金融循环链模式，在业内享有崇高的声</span></p><p><span style=\"color: rgb(12, 12, 12); font-family: 微软雅黑, sans-serif; font-size: 19px; text-indent: 37px;\">&nbsp; &nbsp; &nbsp; &nbsp;誉。2012开始组建团队，研究开发汇泰在线平台。</span></p><p><span style=\"color: rgb(12, 12, 12); font-family: 微软雅黑, sans-serif; font-size: 19px; text-indent: 37px;\"><br/></span></p><hr/><p><strong><span style=\"font-size: 19px; font-family: 微软雅黑, sans-serif; color: rgb(12, 12, 12);\"><img src=\"http://www.huitai188.com/attachment/upload/image/2016/04/27/17/42/45/1461750165607458.png\" title=\"1461750165607458.png\" alt=\"1461750165607458.png\" width=\"115\" height=\"150\" border=\"0\" vspace=\"0\" style=\"width: 115px; height: 150px; float: left;\"/>&nbsp; &nbsp; &nbsp; 甘一坤&nbsp; 首席风险官</span></strong></p><p style=\"text-indent:37px\"><span style=\"font-size: 19px; font-family: 微软雅黑, sans-serif; color: rgb(12, 12, 12);\">甘一坤，曾就职于中国工商银行广西区分行，多年的金融行业从业经验，曾为企业开发专属</span></p><p style=\"text-indent:37px\"><span style=\"font-size: 19px; font-family: 微软雅黑, sans-serif; color: rgb(12, 12, 12);\">风险评估程序体系，超强的风险数据解析，结合产品优势整合资源，降低投资风险。2012年</span></p><p style=\"text-indent:37px\"><span style=\"font-size: 19px; font-family: 微软雅黑, sans-serif; color: rgb(12, 12, 12);\">加入汇泰在线<a name=\"_GoBack\"></a>担任首席风险官，全面负责汇泰金融投资风险控制。</span></p><p style=\"text-indent:37px\"><span style=\"font-size: 19px; font-family: 微软雅黑, sans-serif; color: rgb(12, 12, 12);\"><br/></span></p><hr/><p><img src=\"http://www.huitai188.com/attachment/upload/image/2016/04/27/17/43/47/1461750227524762.png\" title=\"1461750227524762.png\" alt=\"1461750227524762.png\" width=\"261\" height=\"174\" border=\"0\" vspace=\"0\" style=\"width: 261px; height: 174px; float: left;\"/><span style=\"color: rgb(12, 12, 12);\"><strong><span style=\"color: rgb(12, 12, 12); font-size: 19px; font-family: 微软雅黑, sans-serif;\">&nbsp; &nbsp; &nbsp; 营运团队</span></strong></span><br/></p><p><span style=\"font-size: 19px; font-family: 微软雅黑, sans-serif; color: rgb(12, 12, 12);\">&nbsp; &nbsp; &nbsp; 包括运营统筹、策划推广和产品研究，团队成员均来自金融行业中各个平</span></p><p><span style=\"font-size: 19px; font-family: 微软雅黑, sans-serif; color: rgb(12, 12, 12);\">&nbsp; &nbsp; &nbsp; 台</span><span style=\"color: rgb(12, 12, 12); font-family: 微软雅黑, sans-serif; font-size: 19px;\">的精英，拥有非常丰富的运营统筹经验，我们承诺将一直为客户提供最</span></p><p><span style=\"color: rgb(12, 12, 12); font-family: 微软雅黑, sans-serif; font-size: 19px;\">&nbsp; &nbsp; &nbsp; 优</span><span style=\"color: rgb(12, 12, 12); font-family: 微软雅黑, sans-serif; font-size: 19px;\">秀、最便捷、最完善的服务。</span></p><p><br/></p><p><br/></p><hr/><p><span style=\"color: rgb(12, 12, 12);\"><strong><span style=\"color: rgb(12, 12, 12); font-size: 19px; font-family: 微软雅黑, sans-serif;\">&nbsp; &nbsp; &nbsp; &nbsp;技术团队</span></strong></span></p><p><span style=\"font-size: 19px; font-family: 微软雅黑, sans-serif; color: rgb(12, 12, 12);\">&nbsp; &nbsp; &nbsp; &nbsp;技术部门包含:技术总监、UI设计、硬件测试、运维工程师、JAVA工程师。我们承诺将一直为您打造最安 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;全的系统和一流的平台体验。</span></p><p><span style=\"font-size: 19px; font-family: 微软雅黑, sans-serif; color: rgb(12, 12, 12);\"><br/></span></p><hr/><p><span style=\"color: rgb(12, 12, 12);\"><strong><span style=\"color: rgb(12, 12, 12); font-size: 19px; font-family: 微软雅黑, sans-serif;\"></span></strong></span><img src=\"http://www.huitai188.com/attachment/upload/image/2016/04/27/17/44/04/1461750244295444.png\" title=\"1461750244295444.png\" alt=\"1461750244295444.png\" width=\"261\" height=\"174\" border=\"0\" vspace=\"0\" style=\"width: 261px; height: 174px; float: left;\"/><span style=\"color: rgb(12, 12, 12);\"><strong><span style=\"color: rgb(12, 12, 12); font-size: 19px; font-family: 微软雅黑, sans-serif;\">&nbsp; &nbsp; &nbsp;财务团队</span></strong></span><br/></p><p style=\"border: none;padding: 0\"><span style=\"font-size: 19px; font-family: 微软雅黑, sans-serif; color: rgb(12, 12, 12);\">&nbsp; &nbsp; &nbsp;目前财务团队负责网贷资金动态监控以及分公司财务统筹，财务总监曾参与 &nbsp; &nbsp; &nbsp;众多金融行业公司上市申报阶段审计、法定审计、审阅或咨询项目，熟悉企 &nbsp; &nbsp; &nbsp;业会计准则，团队承诺将一直为您提供最便捷的服务和最顺畅的充值提现流 &nbsp; &nbsp; &nbsp;程。</span></p><p><br/></p>', 'no', '0', 'off', 'off', 'regular');
