INSERT INTO `front_nav` VALUES ('18', '诚聘英才', '1', '1', '19', 'id=18', null, '诚聘英才', '诚聘英才', '诚聘英才', 'none', '/about/job/', 'show.html', '<p style=\"white-space: normal;\"><span style=\"color: rgb(12, 12, 12);\"><strong><span style=\"font-size: 20px; font-family: 宋体;\">理财规划师</span></strong></span></p><p style=\"white-space: normal;\"><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">岗位要求：</span></p><p style=\"white-space: normal;\"><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">1</span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">、帮助客户正确分析和评估客户的财务状况，并根据客户所处的生涯阶段和风险承受能力，为客户量身定做一份合理的理财方案。</span></p><p style=\"white-space: normal;\"><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">2</span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">、收集和分析金融信息、确定其走势并做经济预测。　</span></p><p style=\"white-space: normal;\"><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">3</span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">、为客户提供金融和投资的咨询意见。</span></p><p style=\"white-space: normal;\"><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">4</span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">、与公司其他部门配合，并与相关用户进行有效的交流和互动。　</span></p><p style=\"white-space: normal;\"><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">任职资格：</span></p><p style=\"white-space: normal;\"><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">1</span><span style=\"font-size: 12px; font-family: 宋体; color: rgb(77, 77, 77);\">、大专及以上学历，有</span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">3-4</span><span style=\"font-size: 12px; font-family: 宋体; color: rgb(77, 77, 77);\">年以上的从事金融行业理财经验。</span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\"><br/>2</span><span style=\"font-size: 12px; font-family: 宋体; color: rgb(77, 77, 77);\">、具备丰富的金融、投资、经济、法律知识。</span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\"><br/></span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">3</span><span style=\"font-size: 12px; font-family: 宋体; color: rgb(77, 77, 77);\">、具有独立自主的分析设计能力，出色的分析问题解决问题能力。</span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\"><br/></span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">4</span><span style=\"font-size: 12px; font-family: 宋体; color: rgb(77, 77, 77);\">、熟悉国内外行业的发展情况，有丰富的知识，了解市场的发展变化情况。</span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\"><br/></span></p><p style=\"white-space: normal;\"><span style=\"font-size: 12px; font-family: 宋体; color: rgb(77, 77, 77);\"><br/></span></p><p style=\"white-space: normal;\"><span style=\"font-size: 12px; font-family: 宋体; color: rgb(77, 77, 77);\"></span></p><p style=\"white-space: normal; line-height: 24px;\"><span style=\"color: rgb(12, 12, 12);\"><strong><span style=\"font-size: 20px; font-family: 宋体;\">客服专员</span></strong></span></p><p style=\"white-space: normal; line-height: 24px;\"><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">职位描述:<br/>1、负责P2P网贷平台线上办理投融资业务的客户开户、交易等业务办理工作;<br/>2、负责客户资料的收集和系统录入,并分析相应数据推导、提炼客户需求;<br/>3、负责P2P网站平台在线QQ和400免费热线的业务咨询和回复工作，并做好记录登记工作;<br/>4、负责网站平台的信息发布栏目中的信息查核工作，通过短信、邮件、电话等形式向网站客户进行信息传达工作</span><span style=\"font-size: 12px; font-family: 宋体; color: rgb(77, 77, 77);\">，</span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">负责网站平台相关数据信息收集和统计工作</span><span style=\"font-size: 12px; font-family: 宋体; color: rgb(77, 77, 77);\">；</span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\"><br/></span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">5</span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">、对线上业务咨询非注册用户进行公司产品营销;定期跟踪所服务的客户，了解客户的需求，建立深层次客户关系;<br/></span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">6</span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">、负责定期对业务查询和现有客户等的情况做出系统的分析及制定报表。<br/>任职资格：<br/>1.、20&nbsp;至&nbsp;35&nbsp;岁，大专或以上学历，计算机、电子商务、金融、经济类专业优先；<br/>2、有银行、理财、信托、保险服务从业经验和管理经验优先考虑；<br/>3、有良好的客户沟通和协调能力；良好的人际交往及维系客户关系的能力；<br/></span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">4</span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">、有金融行业或大型电子商务类企业工作经验者优先。<br/></span></p><p><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\"><br/></span></p><p style=\"white-space: normal;\"><span style=\"font-size: 12px; font-family: 宋体; color: rgb(77, 77, 77);\"></span></p><p style=\"white-space: normal;\"><span style=\"color: rgb(12, 12, 12);\"><strong><span style=\"font-size: 20px; font-family: 宋体;\">市场推广专员</span></strong></span></p><p style=\"white-space: normal; line-height: 18px;\"><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">岗位职责：<br/>1、精通官方微博、微信公众平台、SNS、百度知道、SEM、SEO等；<br/></span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">2</span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">、负责跟踪微博、微信推广效果，分析后台数据，并反馈总结报告；<br/></span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">3</span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">、根据品牌推广需求，制定阶段性新媒体营销推广方案；<br/></span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">4</span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">、社会化媒体活动传播方案的策划，传播文案的创意、撰写，并执行发布；<br/></span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">5</span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">、与合作方展开线上活动策划，并对策划、执行过程进行全程督导；<br/></span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">6</span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">、参与公司网站的市场推广及创意、网络推广以及相关活动主题策划;提高网站访问量，提升品牌影响力。<br/>任职资格：<br/>1、大学专科（含）以上学历，有记者、编辑经验者优先（有网络媒体工作经验优先)；<br/>2、工作经验要求：&nbsp;2年以上相关岗位工作经验，中文、新闻类，传播类、营销等专业的优先考虑&nbsp;；<br/>3、有出色的话题策划能力，能独立撰写具体版面及宣传文稿、新闻文案等&nbsp;；<br/>4、具备原创性或策略性思考能力，很强的理解力和接受能力&nbsp;；<br/>5、熟悉并关注微博，微信，论坛等社会化媒体的游戏规则；<br/></span></p><p style=\"white-space: normal;\"><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">&nbsp;</span></p><p style=\"white-space: normal;\"><span style=\"color: rgb(12, 12, 12);\"><strong><span style=\"font-size: 20px; font-family: Tahoma, sans-serif;\">PHP开发工程师</span></strong></span></p><p style=\"white-space: normal;\"><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">主要职责：<br/>在PHP组长带领下，负责项目开发，项目攻关，后期维护。<br/>任职条件：<br/>1、计算机或相关专业，1年以上网站开发经验；<br/>2、掌握PHP程序开发，熟悉面向对象（OOP）程序设计和实现；<br/>3、熟练使用MySQL</span><span style=\"font-size: 12px; font-family: 宋体; color: rgb(77, 77, 77);\">，</span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">掌握SQL语言，有一定的数据库规划能力；<br/></span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">4</span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">、了解Linux环境</span><span style=\"font-size: 12px; font-family: 宋体; color: rgb(77, 77, 77);\">，</span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">至少熟练掌握一种JavaScript开发框架，如jQ<a name=\"_GoBack\"></a>uery；<br/></span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">5</span><span style=\"font-size: 12px; font-family: Tahoma, sans-serif; color: rgb(77, 77, 77);\">、熟练掌握一种php&nbsp;MVC框架，熟悉ThinkPHP框架。<br/><br/></span></p><p><span style=\"color: rgb(12, 12, 12);\"><strong><span style=\"font-size: 20px; font-family: 宋体;\">文案编辑</span></strong></span></p><p style=\"line-height:24px\"><span style=\"font-size:12px;font-family:&#39;Tahoma&#39;,&#39;sans-serif&#39;;color:#4D4D4D\">岗位职责：</span></p><p style=\"line-height:24px\"><span style=\"font-size:12px;font-family:&#39;Tahoma&#39;,&#39;sans-serif&#39;;color:#4D4D4D\">1</span><span style=\"font-size:12px;font-family:&#39;Tahoma&#39;,&#39;sans-serif&#39;;color:#4D4D4D\">、网络文案（软硬文、论坛、博客、微博等）的编辑以及专题撰文；<br/> 2、与各部门配合负责公司、产品、市场活动等文案撰写；<br/> 3、根据产品周期，结合产品特色撰写相应说明及推广文案；<br/> 4、独立采编并整理信息，为运营推广等具体工作提供文案支持；<br/> 5、根据宣传推广的具体需要编辑不同风格的文案</span><span style=\"font-size:12px;font-family: 宋体;color:#4D4D4D\">，</span><span style=\"font-size:12px;font-family:&#39;Tahoma&#39;,&#39;sans-serif&#39;;color:#4D4D4D\">新浪.微信公众号软文撰写</span><span style=\"font-size:12px;font-family:宋体;color:#4D4D4D\">。</span><span style=\"font-size:12px;font-family:&#39;Tahoma&#39;,&#39;sans-serif&#39;;color:#4D4D4D\"><br/> </span><span style=\"font-size:12px;font-family:&#39;Tahoma&#39;,&#39;sans-serif&#39;;color:#4D4D4D\">任职要求：<br/> 1、大专及以上学历，有金融行业相关经验者优先；<br/> 2、有1年及以上的文字编辑经验，思维活跃，逻辑性强，良好的文字表达能力，出色的语言组织能力和书面表达能力；有丰富的想象力和强烈的创作欲望，熟练的文字驾驭能力，文笔流畅，创意能力突出；<br/> 3、有新闻敏感度，能及时抓住时事热点及新闻动态；<br/> 4、有较强的语言组织能力；<br/> </span><span style=\"font-size:12px;font-family:&#39;Tahoma&#39;,&#39;sans-serif&#39;;color:#4D4D4D\">5</span><span style=\"font-size:12px;font-family:&#39;Tahoma&#39;,&#39;sans-serif&#39;;color:#4D4D4D\">、对互联网有一定的了解；<br/> 有文案编辑、网站编辑、微信编辑经验的优先录取、新闻采编、广告专业优先录取，面试时请携带作品！ </span></p><p style=\"line-height: 18px\"><span style=\"font-size: 12px;font-family: Tahoma, sans-serif\">&nbsp;</span></p><p style=\"line-height:24px\"><span style=\"color: rgb(12, 12, 12);\"><strong><span style=\"font-size: 20px; font-family: 宋体;\">前台接待</span></strong></span></p><p style=\"line-height:24px\"><span style=\"font-size:12px;font-family:&#39;Tahoma&#39;,&#39;sans-serif&#39;;color:#4D4D4D\">岗位职责<br/> 1、负责公司前台接待及电话接转；<br/> 2、收发传真，复印文档，收发信件、报刊、文件等；<br/> 3、及时更新和管理员工通讯地址和电话号码等联系信息；<br/> 4、受理会议室预约，协调会议时间，下发会议通知，布置会议室；<br/> 5、负责各级主管交办出差安排等各项工作</span><span style=\"font-size:12px;font-family:宋体;color:#4D4D4D\">，</span><span style=\"font-size:12px;font-family:&#39;Tahoma&#39;,&#39;sans-serif&#39;;color:#4D4D4D\">完成上级交给的其它事务性工作。<br/> 任职资格<br/> 1、文秘、行政管理及相关专业大专以上学历，形象好，气质佳；<br/> 2、一年以上相关工作经验，年龄22-32岁；<br/> 3、熟悉前台工作流程，熟练使用各种办公自动化设备；<br/> 4、工作热情积极、细致耐心，具有良好的沟通能力、协调能力，性格开朗，相貌端正，待人热诚；<br/> 5、熟练使用相关办公软件。<br/> <br/> </span></p><p style=\"margin-left:0;text-indent:0;line-height:24px\"><br/></p><p><span style=\"font-size:12px;font-family:&#39;Tahoma&#39;,&#39;sans-serif&#39;;color:#4D4D4D\">&nbsp;</span></p><p><br/></p><p><br/></p>', 'no', '0', 'off', 'off', 'regular');
