  `password` varchar(32) NOT NULL COMMENT '密码',
  `realname` varchar(50) DEFAULT NULL COMMENT '真实姓名',
  `group_id` int(10) unsigned NOT NULL COMMENT '管理组编号 group_id = admin_group.id',
