-- ----------------------------
-- Table structure for front_module
-- ----------------------------
DROP TABLE IF EXISTS `front_module`;
CREATE TABLE `front_module` (
  `id` int(12) unsigned NOT NULL AUTO_INCREMENT COMMENT '编号',
  `module_name` varchar(100) NOT NULL COMMENT '模块名称',
  `module_class` varchar(50) NOT NULL COMMENT '模块类名称',
  `module_description` varchar(1000) DEFAULT NULL COMMENT '模块描述',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='前台模块表';

-- ----------------------------
-- Records of front_module
