-- ----------------------------
-- Table structure for front_nav
-- ----------------------------
DROP TABLE IF EXISTS `front_nav`;
CREATE TABLE `front_nav` (
  `id` int(12) unsigned NOT NULL AUTO_INCREMENT COMMENT '编号',
  `name` varchar(50) NOT NULL COMMENT '导航名称',
  `pid` int(12) unsigned NOT NULL DEFAULT '0' COMMENT '父分类编号  对应 front_nav.id',
  `module_id` int(12) unsigned NOT NULL DEFAULT '0' COMMENT '模块编号 对应 front_module.id',
  `action_id` int(12) unsigned NOT NULL DEFAULT '0' COMMENT '动作编号 对应 front_action.id',
  `param` varchar(255) DEFAULT NULL COMMENT '附加URL请求参数',
  `tag` varchar(50) DEFAULT NULL COMMENT '调用 KEY',
  `title` varchar(255) DEFAULT NULL COMMENT '栏目标题',
  `keyword` varchar(255) DEFAULT NULL COMMENT '关键字',
  `description` varchar(255) DEFAULT NULL COMMENT '简短描述',
  `display` enum('none','top','menu','foot','all') NOT NULL DEFAULT 'menu' COMMENT '导航显示位置 none:不显示 top:顶部菜单 menu:导航条 foot:底部 all:全部显示',
  `directory` varchar(50) NOT NULL COMMENT '目录名称',
  `page` varchar(50) DEFAULT NULL COMMENT '静态页面名称',
  `content` text COMMENT '详细内容',
  `target` enum('yes','no') NOT NULL DEFAULT 'no' COMMENT '是否新窗口打开 yes:是 no:否',
  `sort` smallint(2) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `require_login` enum('on','off') NOT NULL DEFAULT 'off' COMMENT '是否需要登录 on:是 off:否',
  `display_submenu` enum('on','off') NOT NULL DEFAULT 'off' COMMENT '是否显示子菜单  off:否 on:是',
  `status` enum('regular','singular') NOT NULL DEFAULT 'regular' COMMENT '状态 regular:正常 singular:禁用',
  PRIMARY KEY (`id`),
  KEY `module_id` (`module_id`),
  CONSTRAINT `front_nav_module_id` FOREIGN KEY (`module_id`) REFERENCES `front_module` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=35 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='前台导航条';

-- ----------------------------
-- Records of front_nav
-- ----------------------------

-- ----------------------------
-- Table structure for goods
-- ----------------------------
DROP TABLE IF EXISTS `goods`;
CREATE TABLE `goods` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL DEFAULT '0' COMMENT '名称-（货品名称）',
  `mem_id` int(11) NOT NULL DEFAULT '0' COMMENT '发布人',
  `type_id` int(11) NOT NULL DEFAULT '0' COMMENT '货品类别',
  `price` double NOT NULL DEFAULT '0' COMMENT '运输价格',
  `is_tax` int(11) NOT NULL DEFAULT '0',
  `unit` int(11) NOT NULL DEFAULT '0' COMMENT '单位-(1、吨；2、件)',
  `information_cost` double NOT NULL DEFAULT '0' COMMENT '信息费',
  `is_top` int(11) NOT NULL DEFAULT '0' COMMENT '是否置顶',
  `view_flag` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否显示',
  `audit` int(11) NOT NULL DEFAULT '0' COMMENT '审核-（0、未审核；1、审核通过；2、审核未通过）',
  `min_pic` varchar(255) NOT NULL DEFAULT '0' COMMENT '缩略图',
  `pics` varchar(255) NOT NULL DEFAULT '0' COMMENT '图片集',
  `contents` varchar(255) NOT NULL DEFAULT '0' COMMENT '介绍',
  `click_number` int(11) NOT NULL DEFAULT '0' COMMENT '点击量',
  `add_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '发布时间',
  `update_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `sort` int(11) NOT NULL DEFAULT '0' COMMENT '商品排序',
  `introduce` varchar(255) NOT NULL DEFAULT '0' COMMENT '商品简介',
  `location` varchar(255) NOT NULL DEFAULT '0' COMMENT '始发地',
  `location_city_id` int(11) NOT NULL DEFAULT '0' COMMENT '始发城市',
  `is_loading` int(11) NOT NULL DEFAULT '0' COMMENT '货物状态-(0、未开始；1、进行中；2、已完成)',
  `begin_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '要求开始时间',
  `end_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '要求结束时间',
  `destination` varchar(255) NOT NULL DEFAULT '0' COMMENT '目的地',
  `destination_city_id` int(11) NOT NULL DEFAULT '0' COMMENT '目的地城市',
  `weight` decimal(18,6) NOT NULL DEFAULT '0.000000' COMMENT '重量（吨）',
  `surplus` decimal(18,6) NOT NULL DEFAULT '0.000000' COMMENT '剩余重量',
  `packing` int(11) NOT NULL DEFAULT '0' COMMENT '包装方式',
  `long` int(11) NOT NULL DEFAULT '0' COMMENT '长度(米)',
  `wide` int(11) NOT NULL DEFAULT '0' COMMENT '宽度(米)',
  `high` int(11) NOT NULL DEFAULT '0' COMMENT '高度(米)',
  `need_truck_num` int(11) NOT NULL DEFAULT '0' COMMENT '用车数量/天',
  `need_truck_type_id` int(11) NOT NULL DEFAULT '0' COMMENT '所需车型-(1、半拖车；2、砂石车；3、田螺车)',
  `need_truck_type_details` varchar(255) NOT NULL DEFAULT '0' COMMENT '所需车型介绍',
  `telephone` varchar(255) NOT NULL DEFAULT '0' COMMENT '联系电话',
  `already_order_count` int(11) NOT NULL DEFAULT '0' COMMENT '已报装车数(下单数)',
  `up_contact_men` varchar(255) NOT NULL DEFAULT '0' COMMENT '装货联系人',
  `up_contact_men_tel` varchar(255) NOT NULL DEFAULT '0' COMMENT '装货联系人电话',
  `down_contact_men` varchar(255) NOT NULL DEFAULT '0' COMMENT '卸货联系人',
  `down_contact_men_tel` varchar(255) NOT NULL DEFAULT '0' COMMENT '卸货联系人电话',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

-- ----------------------------
-- Records of goods
-- ----------------------------

