  `url` varchar(255) NOT NULL COMMENT '网站地址',
  `logo` varchar(255) DEFAULT NULL COMMENT '网站LOGO',
  `sort` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '排序 默认0',
  `recommend` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否推荐 0:否 1:是',
