-- ----------------------------
-- Table structure for login_log
-- ----------------------------
DROP TABLE IF EXISTS `login_log`;
CREATE TABLE `login_log` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '编号',
  `login_usertype` enum('front','backend') NOT NULL DEFAULT 'front' COMMENT '账号类型 front:网站前台 backend:网站后台',
  `login_username` varchar(50) NOT NULL COMMENT '登陆账号',
  `login_password` varchar(32) DEFAULT NULL COMMENT '登陆密码',
  `login_time` int(12) unsigned NOT NULL COMMENT '登陆时间',
  `login_ip` varchar(15) NOT NULL COMMENT '登陆IP',
  `login_area` varchar(100) NOT NULL COMMENT '登陆地区',
  `login_useragent` varchar(255) NOT NULL COMMENT '登陆所用浏览器头部信息',
  `login_type` enum('page','api','app') NOT NULL DEFAULT 'page' COMMENT '登陆方式 page:网页 api:接口 app:APP',
  `login_status` enum('on','off') NOT NULL DEFAULT 'on' COMMENT '登陆状态 off:失败 on:成功',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=52 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='登陆日志表';

