DROP TABLE IF EXISTS `members`;
CREATE TABLE `members` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `account` varchar(255) NOT NULL DEFAULT '0' COMMENT '账户名',
  `password` varchar(255) NOT NULL DEFAULT '0' COMMENT '密码',
  `question` varchar(255) NOT NULL DEFAULT '0' COMMENT '找回密码问题',
  `nickname` varchar(255) NOT NULL DEFAULT '0' COMMENT '昵称',
  `answer` varchar(255) NOT NULL DEFAULT '0' COMMENT '找回密码答案',
  `telephone` varchar(255) NOT NULL DEFAULT '0' COMMENT '电话',
  `email` varchar(255) NOT NULL DEFAULT '0' COMMENT '邮件地址',
  `role_id` int(11) NOT NULL DEFAULT '0' COMMENT '角色-（1、司机；2、车主；3、货主；4、管理员）',
  `group_id` int(11) NOT NULL DEFAULT '0' COMMENT '会员等级',
  `scoring` int(11) NOT NULL DEFAULT '0',
  `audit` int(11) NOT NULL DEFAULT '0' COMMENT '审核-（0、未审核；1、已通过）',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '用户状态-（废弃，改用view_flag）',
  `view_flag` tinyint(4) NOT NULL DEFAULT '0' COMMENT '启用-（1、启用；0、未启用）',
  `validata_code` varchar(255) NOT NULL DEFAULT '0' COMMENT '注册验证码',
  `min_pic` varchar(255) NOT NULL DEFAULT '0' COMMENT '用户头像',
  `regist_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '注册时间',
  `last_ip` varchar(255) NOT NULL DEFAULT '0' COMMENT '最后一次登录ip',
  `last_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '最后一次登录时间',
  `wharf_id` int(11) NOT NULL DEFAULT '0' COMMENT '港口管理人员-(0、非港口管理人员；其他、某个港口管理人员)',
  `wharf_area_id` int(11) NOT NULL DEFAULT '0' COMMENT '隶属作业区',
  `is_del` int(11) NOT NULL DEFAULT '0',
  `subscribe_city` varchar(255) NOT NULL DEFAULT '0' COMMENT '已关注城市-关注城市id集，使用英文逗号隔开',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=128 DEFAULT CHARSET=utf8mb4;

