-- ----------------------------
-- Table structure for menu
-- ----------------------------
DROP TABLE IF EXISTS `menu`;
CREATE TABLE `menu` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '编号',
  `title` varchar(50) NOT NULL COMMENT '名称',
  `icon` varchar(50) DEFAULT NULL COMMENT '菜单图标',
  `pid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '上级分类ID pid = menu.id',
  `type` enum('directory','module','link') NOT NULL DEFAULT 'directory' COMMENT 'URL类型  directory:菜单目录 module:模块连接 link:菜单连接',
  `module_id` int(10) unsigned DEFAULT NULL COMMENT '模块编号  module_id = module.id',
  `action_id` int(10) unsigned DEFAULT NULL COMMENT '动作编号 对应action_id = module_action.id',
  `url` varchar(255) DEFAULT NULL,
  `params` varchar(255) DEFAULT NULL COMMENT '参数',
  `sort` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '排序编号',
  `hidden` enum('on','off') NOT NULL DEFAULT 'off' COMMENT '是否隐藏 ''off'':否 ''on'':是',
  `status` enum('on','off') NOT NULL DEFAULT 'on' COMMENT '状态 off:禁用 on:可用',
  PRIMARY KEY (`id`),
  KEY `module_id` (`module_id`),
  KEY `action_id` (`action_id`),
  CONSTRAINT `menu.action` FOREIGN KEY (`action_id`) REFERENCES `module_action` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `menu.module_id` FOREIGN KEY (`module_id`) REFERENCES `module` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=121 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='菜单表';

