  `name` varchar(100) NOT NULL COMMENT '模板名称',
  `keyword` varchar(50) NOT NULL COMMENT '模板调用名称',
  `type` enum('sms','email','message') NOT NULL DEFAULT 'message' COMMENT '消息模板类型 sms:短信 email:邮件 message:站内消息',
  `title` varchar(100) DEFAULT NULL COMMENT '标题  邮件/站内信可用',
