-- ----------------------------
-- Table structure for module_action
-- ----------------------------
DROP TABLE IF EXISTS `module_action`;
CREATE TABLE `module_action` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '编号',
  `pid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'module_action.pid = module.id',
  `title` varchar(50) NOT NULL COMMENT '动作标题',
  `name` varchar(50) NOT NULL COMMENT '动作名称',
  `icon` varchar(50) DEFAULT NULL,
  `description` varchar(255) DEFAULT NULL COMMENT '模块描述',
  `hidden` enum('on','off') NOT NULL DEFAULT 'off' COMMENT '是否隐藏 off:否  on:是',
  `status` enum('on','off') NOT NULL DEFAULT 'on' COMMENT '状态  off:禁用 on:启用',
  `method` set('GET','POST','AJAX') NOT NULL DEFAULT 'GET' COMMENT '动作类型',
  `type` enum('HTML','JSON','FILE') NOT NULL DEFAULT 'HTML' COMMENT '输出内容类型',
  `view` enum('ON','OFF') NOT NULL DEFAULT 'ON' COMMENT '是否含有视图 ON:有 OFF:否',
  `view_type` enum('datagrid','treegrid','report','other') NOT NULL DEFAULT 'datagrid' COMMENT '视图类型  datagrid:数据表格  treegrid:树形表格 report:报表 other:其他类型',
  `view_config` mediumtext COMMENT '视图配置内容',
  `button_config` mediumtext COMMENT '按钮配置内容',
  `sort` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  PRIMARY KEY (`id`),
  KEY `pid` (`pid`),
  CONSTRAINT `module_action.pid` FOREIGN KEY (`pid`) REFERENCES `module` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=420 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='模块动作表';

-- ----------------------------
-- Records of module_action
