DROP TABLE IF EXISTS `orders`;
CREATE TABLE `orders` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `serial_no` varchar(255) NOT NULL DEFAULT '0' COMMENT '订单流水号',
  `truck_mem_id` int(11) NOT NULL DEFAULT '0' COMMENT ' 订购人',
  `truck_team_id` int(11) NOT NULL DEFAULT '0' COMMENT '所属车队',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '订单状态-（0、未付款；1、已下单；2、装货完成；3、卸货完成；4、已取消，未退款；5、已取消）',
  `good_id` int(11) NOT NULL DEFAULT '0' COMMENT '关联货物',
  `remark` varchar(255) NOT NULL DEFAULT '0' COMMENT '订单备注',
  `add_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '下单时间',
  `pay_type` int(11) NOT NULL DEFAULT '0' COMMENT '支付类型-1、支付宝；2、微信支付；3、网银支付',
  `pay_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '支付时间',
  `amount` double NOT NULL DEFAULT '0' COMMENT '实付信息费',
  `company_id` int(11) NOT NULL DEFAULT '0' COMMENT '所属货主公司',
  `container_sn` varchar(255) NOT NULL DEFAULT '0' COMMENT '集装箱箱号',
  `container_feng_sn` varchar(255) NOT NULL DEFAULT '0' COMMENT '集装箱封号',
  `container_spec` int(11) NOT NULL DEFAULT '0' COMMENT '集装箱箱型',
  `cancel_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '取消时间',
  `location_weight` decimal(18,6) NOT NULL DEFAULT '0.000000',
  `location_weighed_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '装货时间',
  `location_weighed_pic` varchar(255) NOT NULL DEFAULT '0' COMMENT '装货过磅单照片',
  `destination_weight` decimal(18,6) NOT NULL DEFAULT '0.000000',
  `dest_container_sn` varchar(255) NOT NULL DEFAULT '0' COMMENT '卸货箱号',
  `dest_container_feng_sn` varchar(255) NOT NULL DEFAULT '0' COMMENT '卸货封号',
  `dest_container_spec` int(11) NOT NULL DEFAULT '0' COMMENT '卸货箱型',
  `destination_weighed_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '卸货时间',
  `dest_container_pic` varchar(255) NOT NULL DEFAULT '0' COMMENT '卸货过磅单照片',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

