DROP TABLE IF EXISTS `sendlist`;
CREATE TABLE `sendlist` (
  `id` int(12) unsigned NOT NULL AUTO_INCREMENT COMMENT '编号',
  `type` enum('email','sms') NOT NULL DEFAULT 'email' COMMENT '类型 email:邮件  sms:短信',
  `template_id` int(12) unsigned NOT NULL COMMENT '发送模板  ',
  `server_id` int(12) unsigned NOT NULL DEFAULT '0' COMMENT '发送服务器编号  邮件对应 mail_server.id  短信对应 sms_server.id',
  `sendto` varchar(100) NOT NULL COMMENT '发送目标  邮箱地址/手机号码',
  `title` varchar(100) DEFAULT NULL COMMENT '标题',
  `content` text NOT NULL COMMENT '内容',
  `user_id` int(12) unsigned NOT NULL DEFAULT '0' COMMENT '会员编号  对应 user.id  发送列表的会员编号有可能是 0 主要是注册邮件/短信验证等',
  `addtime` int(12) unsigned NOT NULL DEFAULT '0' COMMENT '创建队列时间',
  `sendtime` int(12) unsigned NOT NULL DEFAULT '0' COMMENT '队列发送时间',
  `ipaddr` varchar(50) NOT NULL DEFAULT '127.0.0.1' COMMENT '发送 IP 地址',
  `status` enum('pending','regular','singular') NOT NULL DEFAULT 'pending' COMMENT '发送状态  pending:待发  regualar:正常 singular:异常',
  `errorinfo` varchar(255) DEFAULT NULL COMMENT '错误信息',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='邮件短信发送队列';

-- ----------------------------
-- Records of sendlist
-- ----------------------------

-- ----------------------------
-- Table structure for send_activation
