  `activation_ipaddr` varchar(40) NOT NULL DEFAULT '127.0.0.1' COMMENT '发送的 IP 地址',
  `activation_time` int(12) unsigned NOT NULL DEFAULT '0' COMMENT '验证码验证时间',
  `activation_status` enum('pending','regular','singular') NOT NULL DEFAULT 'pending' COMMENT '验证状态 pending:待验证 regular:已验证  singular:验证错误/过期',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=36 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='短信邮件验证表';

