-- ----------------------------
-- Table structure for setting
-- ----------------------------
DROP TABLE IF EXISTS `setting`;
CREATE TABLE `setting` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '编号',
  `title` varchar(255) NOT NULL COMMENT '设置值名称',
  `name` varchar(100) NOT NULL COMMENT '名称',
  `value` text COMMENT '值',
  `hint` varchar(255) DEFAULT NULL COMMENT '提示内容',
  `description` varchar(255) DEFAULT NULL COMMENT '设置值描述',
  `type` enum('textbox','password','date','datetime','time','currency','number','integer','hidden','image','file','button','textlink','combobox','radio','checkbox','popup','listbox','textarea','editor') NOT NULL DEFAULT 'textbox' COMMENT '设置值类型',
  `default_value` varchar(255) DEFAULT NULL COMMENT '默认值',
  `data_source` enum('custom','database','server_data') NOT NULL DEFAULT 'custom' COMMENT '数据源  custom:自定义  database:数据库 server_data:ajax请求数据',
  `server_url` varchar(255) DEFAULT NULL COMMENT 'URL地址',
  `data_table` varchar(200) DEFAULT NULL COMMENT '数据表',
  `data_id` varchar(200) DEFAULT NULL COMMENT '数据表编号字段',
  `data_title` varchar(200) DEFAULT NULL COMMENT '数据表文本字段',
  `data_pid` varchar(200) DEFAULT NULL COMMENT '数据表父编号字段',
  `data` varchar(1000) DEFAULT NULL COMMENT '选项值 combobox,tree,radio,checkbox才需要设置该选项',
  `category` varchar(100) NOT NULL DEFAULT 'system' COMMENT '所属设置',
  `tab_name` varchar(50) DEFAULT NULL COMMENT '所属标签页',
  `group_name` varchar(50) NOT NULL DEFAULT '' COMMENT '分组名称',
  `allow_empty` enum('on','off') NOT NULL DEFAULT 'on' COMMENT '是否允许为空  on:允许 off:禁止',
  `min_length` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '允许输入最小长度 0:为不限制',
  `max_length` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '允许输入最大长度 0:为不限制',
  `size_width` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '输入控件宽度 0:默认宽度',
  `size_height` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '输入控件高度 0:默认高度',
  `tag` int(10) unsigned DEFAULT '0' COMMENT '额外标记',
  `combo_type` enum('normal','grid','tree') NOT NULL DEFAULT 'normal' COMMENT '下拉类型 normal:普通下拉  grid:表格下拉  tree:树形下拉',
  `is_multi` enum('on','off') NOT NULL DEFAULT 'off' COMMENT '是否多选 仅限 combobox , listbox',
  `is_sys` enum('on','off') NOT NULL DEFAULT 'off' COMMENT '是否系统设置 off:否 on:是',
  `validator` enum('required','email','url','date','number','digits','creditcard') NOT NULL DEFAULT 'required' COMMENT '验证规则',
  `read_only` enum('on','off') NOT NULL DEFAULT 'off' COMMENT '是否只读 on:开启只读 off:关闭只读',
  `onclick` varchar(100) DEFAULT NULL COMMENT '点击事件',
  `onchange` varchar(100) DEFAULT NULL COMMENT '值改变事件',
  `sort` smallint(2) NOT NULL DEFAULT '0' COMMENT '排序',
  PRIMARY KEY (`id`),
  UNIQUE KEY `setting_name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=117 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='配置系统配置';

-- ----------------------------
-- Records of setting
-- ----------------------------

