-- Table structure for user
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '编号',
  `username` varchar(50) CHARACTER SET utf8 NOT NULL COMMENT '用户名',
  `usertype` enum('person','enterprise') NOT NULL DEFAULT 'person' COMMENT '账号类型  person:个人 enterprise:企业',
  `login_type` enum('normal','mobile','ip','tryerror') NOT NULL DEFAULT 'normal' COMMENT '登陆保护类型   normal:关闭保护 mobile:验证手机  ip:IP变更后需要手机验证  tryerror:登录密码输入出错超过3次需要手机验证',
  `birthday` varchar(10) NOT NULL DEFAULT '00-00' COMMENT '会员生日',
  `origin` enum('site','league') NOT NULL DEFAULT 'site' COMMENT '用户来源 site:自有用户 league:广告联盟',
  `password` varchar(32) CHARACTER SET utf8 NOT NULL COMMENT '登陆密码',
  `trader_password` varchar(32) CHARACTER SET utf8 DEFAULT NULL COMMENT '交易密码',
  `mobile` varchar(15) CHARACTER SET utf8 NOT NULL COMMENT ' 手机号',
  `email` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '邮箱',
  `money` decimal(15,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '账号余额',
  `money_freeze` decimal(15,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '冻结资金',
  `point` int(12) unsigned NOT NULL DEFAULT '0' COMMENT '会员积分',
  `referrer_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '推荐人 对应user.id',
  `register_ip` varchar(50) CHARACTER SET utf8 NOT NULL DEFAULT '127.0.0.1' COMMENT '注册IP',
  `register_time` int(12) unsigned NOT NULL COMMENT '注册时间',
  `login_ip` varchar(50) CHARACTER SET utf8 NOT NULL DEFAULT '127.0.0.1' COMMENT '登陆IP',
  `login_time` int(12) unsigned NOT NULL DEFAULT '0' COMMENT '登陆时间',
  `authreal_status` enum('on','off') NOT NULL DEFAULT 'off' COMMENT '实名状态 on:已认证 off:未认证',
  `question_status` enum('on','off') NOT NULL DEFAULT 'off' COMMENT '安全问题状态 off:未设置 on:已设置',
  `status` enum('regular','pending','deny') NOT NULL DEFAULT 'regular' COMMENT '状态 regular:正常 pending:待审 deny:禁止登陆',
  PRIMARY KEY (`id`),
  UNIQUE KEY `username` (`username`),
  UNIQUE KEY `mobile` (`mobile`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='用户表';

-- ----------------------------
-- Records of user
-- ----------------------------

-- ----------------------------
-- Table structure for users_session
-- ----------------------------
DROP TABLE IF EXISTS `users_session`;
CREATE TABLE `users_session` (
  `member_id` int(10) NOT NULL,
  `token_key` varchar(255) CHARACTER SET utf8 NOT NULL DEFAULT '',
  `role_id` int(10) NOT NULL DEFAULT '0',
  `user_data` varchar(255) CHARACTER SET utf8 NOT NULL DEFAULT '',
  `login_type` varchar(255) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '登录的客户端类型',
  `login_time` int(10) NOT NULL DEFAULT '0',
  `login_ip` varchar(255) CHARACTER SET utf8 NOT NULL DEFAULT '',
  `expire_time` int(10) NOT NULL DEFAULT '0',
  PRIMARY KEY (`member_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

-- ----------------------------
-- Records of users_session
-- ----------------------------

-- ----------------------------
-- Table structure for user_identity
-- ----------------------------
DROP TABLE IF EXISTS `user_identity`;
CREATE TABLE `user_identity` (
  `id` int(12) unsigned NOT NULL AUTO_INCREMENT COMMENT '编号',
  `user_id` int(12) unsigned NOT NULL COMMENT '用户编号  对应 user.id',
  `identity_name` varchar(50) NOT NULL COMMENT '真实姓名',
  `identity_type` int(12) unsigned NOT NULL DEFAULT '1' COMMENT '证件类型 对应 identity_type.id',
  `identity_number` varchar(50) NOT NULL COMMENT '证件号码',
  `identity_image_front` varchar(255) DEFAULT NULL COMMENT '证件扫描件正面',
  `identity_image_back` varchar(255) DEFAULT NULL COMMENT '证件扫描件背面',
  `identity_count` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '认证次数 默认0 超过3次，只能联系客服手工认证',
  `admin_id` int(12) unsigned NOT NULL DEFAULT '0' COMMENT '管理员编号  对应 admin.id',
  `create_time` int(12) unsigned NOT NULL DEFAULT '0' COMMENT '申请认证时间',
  `review_time` int(12) unsigned NOT NULL DEFAULT '0' COMMENT '审核时间',
  `status` enum('pending','regular','singular') NOT NULL DEFAULT 'regular' COMMENT '证件认证状态 pending:待审  regualar:通过 singular:失败',
  PRIMARY KEY (`id`),
  UNIQUE KEY `user_id` (`user_id`),
  KEY `identity_type` (`identity_type`),
  CONSTRAINT `user_identity.identity_type` FOREIGN KEY (`identity_type`) REFERENCES `identity_type` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `user_identity.user_id` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='用户实名认证信息';

-- ----------------------------
-- Records of user_identity
-- ----------------------------

-- ----------------------------
-- Table structure for user_message
-- ----------------------------
DROP TABLE IF EXISTS `user_message`;
CREATE TABLE `user_message` (
  `id` int(12) unsigned NOT NULL AUTO_INCREMENT COMMENT '编号',
  `user_id` int(12) unsigned NOT NULL DEFAULT '0' COMMENT '用户编号 对应 user.id',
  `title` varchar(100) NOT NULL COMMENT '消息主题',
  `content` varchar(255) NOT NULL COMMENT '消息内容',
  `type` enum('read','unread') NOT NULL DEFAULT 'unread' COMMENT '消息类型 read:已读 unread:未读',
  `create_time` int(12) unsigned NOT NULL COMMENT '发送时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='用户消息表';

-- ----------------------------
-- Records of user_message
-- ----------------------------

-- ----------------------------
-- Table structure for user_operate_log
-- ----------------------------
DROP TABLE IF EXISTS `user_operate_log`;
CREATE TABLE `user_operate_log` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `mem_id` varchar(255) NOT NULL,
  `account` varchar(255) NOT NULL DEFAULT '0' COMMENT '所属机构',
  `wharf_id` int(11) NOT NULL DEFAULT '0',
  `user_ip` varchar(255) DEFAULT NULL,
  `operate_info` varchar(255) DEFAULT NULL,
  `description` varchar(255) DEFAULT NULL,
  `if_success` tinyint(4) NOT NULL DEFAULT '0',
  `operate_date` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

-- ----------------------------
-- Records of user_operate_log
-- ----------------------------

-- ----------------------------
-- Table structure for user_point_log
-- ----------------------------
DROP TABLE IF EXISTS `user_point_log`;
CREATE TABLE `user_point_log` (
  `id` int(14) unsigned NOT NULL AUTO_INCREMENT COMMENT '编号',
  `user_id` int(12) unsigned NOT NULL DEFAULT '0' COMMENT '用户编号 对应 user.id',
  `type` enum('invest','reimburse','loan','repayment','recharge','exchange','withdraw','task','lottery') NOT NULL DEFAULT 'invest' COMMENT '积分类型 invest:投资 reimburse:流标补偿 loan:贷款 repayment:还款 recharge:充值 withdraw:提现 exchange:兑换 task:任务 lottery:抽奖',
  `modify_type` enum('add','reduce') NOT NULL DEFAULT 'add' COMMENT '积分变更类型 add:增加 reduce:减少',
  `point` int(12) unsigned NOT NULL DEFAULT '0' COMMENT '变更积分数量',
  `create_time` int(12) NOT NULL COMMENT '创建时间',
  `comment` varchar(200) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=44 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='用户积分记录';

-- ----------------------------
-- Records of user_point_log
-- ----------------------------

-- ----------------------------
-- Table structure for user_profile
-- ----------------------------
DROP TABLE IF EXISTS `user_profile`;
CREATE TABLE `user_profile` (
  `id` int(12) unsigned NOT NULL AUTO_INCREMENT COMMENT '编号',
  `user_id` int(12) unsigned NOT NULL DEFAULT '0' COMMENT '用户编号 对应user.id',
  `marry` enum('married','single','widowed','divorced','other') NOT NULL DEFAULT 'married' COMMENT '婚姻状况 married:已婚 single:单身 widowed:丧偶 divorced:离异 other:其他',
  `with_children` enum('yes','no') NOT NULL DEFAULT 'yes' COMMENT '有无子女 yes:有 no:无',
  `endowment_insurance` enum('yes','no') NOT NULL DEFAULT 'yes' COMMENT '是否有养老保险 yes:有 no:无',
  `life_insurance` enum('yes','no') NOT NULL DEFAULT 'yes' COMMENT '是否有人寿保险 yes:有 no:无',
  `employ_type` enum('wage','boss') NOT NULL DEFAULT 'wage' COMMENT '雇佣类型 wage:受薪人士(打工) boss:自雇人士(老板)',
  `education` enum('pre','college','undergraduate','master','doctor') NOT NULL DEFAULT 'pre' COMMENT '最高学历 pre:高中及以下 college:大学专科 undergraduate:大学本科 master:硕士研究生 doctor:博士研究生',
  `certificate_province` varchar(50) DEFAULT NULL COMMENT '证件地址省份',
  `certificate_city` varchar(50) DEFAULT NULL COMMENT '证件地址城市',
  `certificate_address` varchar(200) DEFAULT NULL COMMENT '证件地址详细地址',
  `residence_province` varchar(50) DEFAULT NULL COMMENT '居住地址 省份',
  `residence_city` varchar(50) DEFAULT NULL COMMENT '居住地址城市',
  `residence_address` varchar(200) DEFAULT NULL COMMENT '居住地址详细地址',
  PRIMARY KEY (`id`),
  UNIQUE KEY `user_id` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='用户个人资料';

-- ----------------------------
-- Records of user_profile
-- ----------------------------

-- ----------------------------
-- Table structure for user_recharge
-- ----------------------------
DROP TABLE IF EXISTS `user_recharge`;
CREATE TABLE `user_recharge` (
  `id` int(12) unsigned NOT NULL AUTO_INCREMENT COMMENT '编号',
  `user_id` int(12) unsigned NOT NULL DEFAULT '0' COMMENT '用户编号 对应 user.id',
  `recharge_sn` varchar(50) NOT NULL COMMENT '充值流水号',
  `payment_sn` varchar(50) DEFAULT NULL COMMENT '支付接口流水号',
  `bank_id` int(12) unsigned NOT NULL DEFAULT '0' COMMENT '用户银行编号 对应 user_bank.id  网银充值该值为0',
  `payment_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '充值接口 对应 payment.id',
  `money` decimal(15,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '充值金额',
  `fee` decimal(15,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '手续费',
  `method` enum('online','offline','withhold') NOT NULL DEFAULT 'online' COMMENT '充值方式 online:在线支付 offline:线下充值 withhold:代扣',
  `status` enum('success','failure','pending') NOT NULL DEFAULT 'pending' COMMENT '充值状态 success:成功  failure:失败 pending:处理中',
  `status_info` varchar(200) DEFAULT NULL COMMENT '状态信息',
  `admin_id` int(12) unsigned NOT NULL DEFAULT '0' COMMENT '线下充值人 0:为非线下处理',
  `type` enum('quick','netbank','offline') NOT NULL DEFAULT 'offline' COMMENT '支付类型 quick:快捷支付 netbank:网银支付 offline:线下付款',
  `use_type` enum('balance','finance','debt','refund') NOT NULL DEFAULT 'balance' COMMENT '充值类型  balance:余额充值 finance:理财产品 debt:债权购买 refund:还款',
  `use_obj` int(12) unsigned NOT NULL DEFAULT '0' COMMENT '目标类型编号 根据use_type进行对应处理 ',
  `create_time` int(12) unsigned NOT NULL DEFAULT '0' COMMENT '充值时间',
  `update_time` int(12) unsigned NOT NULL DEFAULT '0' COMMENT '处理时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='用户充值记录';

-- ----------------------------
-- Records of user_recharge
-- ----------------------------

-- ----------------------------
-- Table structure for user_secure_question
-- ----------------------------
DROP TABLE IF EXISTS `user_secure_question`;
CREATE TABLE `user_secure_question` (
  `id` int(12) unsigned NOT NULL AUTO_INCREMENT COMMENT '编号',
  `user_id` int(12) unsigned NOT NULL DEFAULT '0' COMMENT '用户编号 对应user.id',
  `question1` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '安全保护1问题编号 对应 secure_question_type.id',
  `answer1` varchar(50) NOT NULL COMMENT '安全问题1答案',
  `question2` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '安全保护2问题编号 对应 secure_question_type.id',
  `answer2` varchar(50) NOT NULL COMMENT '安全问题2答案',
  `question3` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '安全保护3问题编号 对应 secure_question_type.id',
  `answer3` varchar(50) NOT NULL COMMENT '安全问题3答案',
  PRIMARY KEY (`id`),
  UNIQUE KEY `question_user_id` (`user_id`),
  KEY `question1` (`question1`),
  KEY `question2` (`question2`),
  KEY `question3` (`question3`),
  CONSTRAINT `secure_question1` FOREIGN KEY (`question1`) REFERENCES `secure_question_type` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `secure_question2` FOREIGN KEY (`question2`) REFERENCES `secure_question_type` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `secure_question3` FOREIGN KEY (`question3`) REFERENCES `secure_question_type` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='用户安全保护问题答案';

-- ----------------------------
-- Records of user_secure_question
-- ----------------------------

-- ----------------------------
-- Table structure for vehicle
-- ----------------------------
DROP TABLE IF EXISTS `vehicle`;
CREATE TABLE `vehicle` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '车辆编号',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '车辆状态',
  `pending` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '审核状态',
  `user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '用户编号',
  `licence_plate_number` char(7) NOT NULL DEFAULT '' COMMENT '车牌号码',
  `licence_plate_color` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '车牌颜色1:蓝;2:黄;3:绿',
  `engine_number` varchar(10) NOT NULL DEFAULT '' COMMENT '发动机号码',
  `identification_number` varchar(17) NOT NULL DEFAULT '' COMMENT '车架号 (车辆识别号)',
  `transport_certificate` char(12) NOT NULL DEFAULT '' COMMENT '道路运输证',
  `loading_capacity` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '额定载重 (吨)',
  `model` tinyint(1) NOT NULL DEFAULT '0' COMMENT '车辆型号',
  `length` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '车辆长度',
  `created_at` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `updated_at` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '修改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='车辆表';

-- ----------------------------
-- Records of vehicle
-- ----------------------------

-- ----------------------------
-- Table structure for wharf
-- ----------------------------
DROP TABLE IF EXISTS `wharf`;
CREATE TABLE `wharf` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL DEFAULT '0' COMMENT '码头名字',
  `city_id` int(11) NOT NULL DEFAULT '0' COMMENT '所在城市',
  `code` varchar(255) NOT NULL DEFAULT '0' COMMENT '码头代号-生产排队号时候用',
  `address` varchar(255) NOT NULL DEFAULT '0' COMMENT '具体地址',
  `contact_men` varchar(255) NOT NULL DEFAULT '0' COMMENT '联系人',
  `telephone` varchar(255) NOT NULL DEFAULT '0' COMMENT '联系电话',
  `longitude` decimal(9,6) NOT NULL DEFAULT '0.000000' COMMENT '经度',
  `latitude` decimal(9,6) NOT NULL DEFAULT '0.000000' COMMENT '纬度',
  `view_flag` tinyint(4) NOT NULL DEFAULT '0' COMMENT '启用',
  `fouls` int(11) NOT NULL DEFAULT '0',
  `check_in_distance` double NOT NULL DEFAULT '0' COMMENT '签到距离-单位米',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

-- ----------------------------
-- Records of wharf
-- ----------------------------

-- ----------------------------
-- Table structure for wharf_area
-- ----------------------------
DROP TABLE IF EXISTS `wharf_area`;
CREATE TABLE `wharf_area` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL DEFAULT '0' COMMENT '港口作业区',
  `city_id` int(11) NOT NULL DEFAULT '0' COMMENT '所属城市',
  `wharf_id` int(11) NOT NULL DEFAULT '0' COMMENT '隶属港口',
  `longitude` decimal(9,6) NOT NULL DEFAULT '0.000000' COMMENT '所在经度',
  `latitude` decimal(9,6) NOT NULL DEFAULT '0.000000' COMMENT '所在纬度',
  `check_in_distance` double NOT NULL DEFAULT '0' COMMENT '签到距离-单位米',
  `view_flag` tinyint(4) NOT NULL DEFAULT '0' COMMENT '启用',
  `remark` varchar(255) NOT NULL DEFAULT '0' COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

-- ----------------------------
-- Records of wharf_area
